		if (/iPhone|iPad/i.test(navigator.userAgent))
		{
			console.log("iOS Device");
			this.vol_mute.visible = false;
			this.vol_dwn.visible = false;
			this.vol_up.visible = false;
			this.vol_box.visible = false;
			this.btn_sound.visible = true;
		}
		
