		//Menu function========================================
		function openMenu(){
		
		 window.open ("../menu/menu.html","_self");
		}
		
		//volume functions======================================
		function volDwn()
		{
			createjs.Sound.volume = createjs.Sound.volume -0.1;
			if(!mute){
				bgm.volume -= 0.1;
				prev_vol = bgm.volume;
			}
			console.log(bgm.volume);
			console.log(prev_vol);
		}
		function volUp()
		{
			createjs.Sound.volume = createjs.Sound.volume +0.1;
			if(!mute){
				bgm.volume += 0.1;
				prev_vol = bgm.volume;
			}
			console.log(bgm.volume);
			console.log(prev_vol);
		}
		
		function volMute()
		{
			if(!mute){
				mute = true
				bgm.volume = 0;
			}
			else{
				mute = false;
				bgm.volume = prev_vol;
			}
			console.log(mute);
		}
		
		//Nav functions -----------------------------------------
		function openNext(){
		
		 window.open ("sva_Scene5.html","_self");
		}
		
		function openPrev(){
		
		 window.open ("sva_Scene3.html","_self");
		}
